/*Table structure for table `artifact_property_value_history` */

DROP TABLE IF EXISTS `artifact_property_value_history`;

CREATE TABLE `artifact_property_value_history` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `ARTIFACT_PROPERTY_ID` bigint(20) DEFAULT NULL COMMENT '所属工件属性ID',
  `OWNER_TYPE` varchar(250) DEFAULT NULL COMMENT '所有者类型：工件模板、节点工件、节点工件实例',
  `OWNER_ID` bigint(20) DEFAULT NULL COMMENT '所有者ID',
  `VALUE` varchar(250) DEFAULT NULL COMMENT '属性值',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `artifact_property_value_history` */

/*Table structure for table `artifact_tag` */

DROP TABLE IF EXISTS `artifact_tag`;

CREATE TABLE `artifact_tag` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `ARTIFACT_ID` bigint(20) DEFAULT NULL COMMENT '所属工件ID',
  `NAME` varchar(250) DEFAULT NULL COMMENT '标签名称',
  PRIMARY KEY (`ID`),
  KEY `FK_artifact` (`ARTIFACT_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=1151 DEFAULT CHARSET=utf8;

