/*Table structure for table `file_version` */

DROP TABLE IF EXISTS `file_version`;

CREATE TABLE `file_version` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `VERSION` bigint(20) DEFAULT NULL COMMENT '数据版本',
  `FILE_ID` bigint(20) DEFAULT NULL COMMENT '所属文件ID',
  `FILE_STORAGE_ID` bigint(20) DEFAULT NULL COMMENT '关联文件存储ID',
  `NAME` varchar(250) DEFAULT NULL COMMENT '名称',
  `FILE_VERSION` varchar(250) DEFAULT NULL COMMENT '文件版本',
  `CREATED_BY` bigint(20) DEFAULT NULL COMMENT '创建人',
  `CREATION_DATE` datetime DEFAULT NULL COMMENT '创建时间',
  `LAST_UPDATED_BY` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `LAST_UPDATED_DATE` datetime DEFAULT NULL COMMENT '最后更新时间',
  `ENABLED_FLAG` char(1) DEFAULT NULL COMMENT '有效性',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=1133 DEFAULT CHARSET=utf8;

