/*Table structure for table `node` */

DROP TABLE IF EXISTS `node`;

CREATE TABLE `node` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `VERSION` bigint(20) DEFAULT NULL COMMENT '数据版本',
  `APP_ID` bigint(20) DEFAULT NULL COMMENT '所属应用ID',
  `NODE_TYPE_ID` bigint(20) DEFAULT NULL COMMENT '所属节点类型ID',
  `NAME` varchar(250) DEFAULT NULL COMMENT '名称',
  `DESC` varchar(1000) DEFAULT NULL COMMENT '描述',
  `IS_ELASTIC` char(1) DEFAULT NULL COMMENT '是否支持弹性调度',
  `MIN_ENGINE_NUM` bigint(20) DEFAULT NULL COMMENT '最小引擎数',
  `MAX_ENGINE_NUM` bigint(20) DEFAULT NULL COMMENT '最大引擎数',
  `CREATED_BY` bigint(20) DEFAULT NULL COMMENT '创建人',
  `CREATION_DATE` datetime DEFAULT NULL COMMENT '创建时间',
  `LAST_UPDATED_BY` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `LAST_UPDATED_DATE` datetime DEFAULT NULL COMMENT '最后更新时间',
  `ENABLED_FLAG` char(1) DEFAULT NULL COMMENT '有效性',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=1276 DEFAULT CHARSET=utf8;

