/*Table structure for table `node_artifact_history` */

DROP TABLE IF EXISTS `node_artifact_history`;

CREATE TABLE `node_artifact_history` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `VERSION` bigint(20) DEFAULT NULL COMMENT '数据版本',
  `ARTIFACT_VERSION_ID` bigint(20) DEFAULT NULL COMMENT '所属工件版本ID',
  `NODE_HISTORY_ID` bigint(20) DEFAULT NULL COMMENT '所属节点ID',
  `ORDER` int(11) DEFAULT NULL COMMENT '序号',
  `CREATED_BY` bigint(20) DEFAULT NULL COMMENT '创建人',
  `CREATION_DATE` datetime DEFAULT NULL COMMENT '创建时间',
  `LAST_UPDATED_BY` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `LAST_UPDATED_DATE` datetime DEFAULT NULL COMMENT '最后更新时间',
  `ENABLED_FLAG` char(1) DEFAULT NULL COMMENT '有效性',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `node_artifact_history` */

/*Table structure for table `node_artifact_instance` */

DROP TABLE IF EXISTS `node_artifact_instance`;

CREATE TABLE `node_artifact_instance` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `VERSION` bigint(20) DEFAULT NULL COMMENT '数据版本',
  `ARTIFACT_VERSION_ID` bigint(20) DEFAULT NULL COMMENT '所属工件版本ID',
  `NODE_INSTANCE_ID` bigint(20) DEFAULT NULL COMMENT '所属节点实例ID',
  `INSTANCE_ID` varchar(250) DEFAULT NULL COMMENT '工件实例ID',
  `ORDER` int(11) DEFAULT NULL COMMENT '序号',
  `STATUS` varchar(250) DEFAULT NULL COMMENT '状态',
  `CR_STATUS` varchar(250) DEFAULT NULL COMMENT '部署升级状态：升级时使用，升级后恢复为NULL',
  `CREATED_BY` bigint(20) DEFAULT NULL COMMENT '创建人',
  `CREATION_DATE` datetime DEFAULT NULL COMMENT '创建时间',
  `LAST_UPDATED_BY` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `LAST_UPDATED_DATE` datetime DEFAULT NULL COMMENT '最后更新时间',
  `ENABLED_FLAG` char(1) DEFAULT NULL COMMENT '有效性',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=1382 DEFAULT CHARSET=utf8;

