/*Table structure for table `node_file` */

DROP TABLE IF EXISTS `node_file`;

CREATE TABLE `node_file` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `VERSION` bigint(20) DEFAULT NULL COMMENT '数据版本',
  `NODE_ID` bigint(20) DEFAULT NULL COMMENT '所属节点ID',
  `FILE_VERSION_ID` bigint(20) DEFAULT NULL COMMENT '关联文件版本ID',
  `RELATIVE_PATH` varchar(500) DEFAULT NULL COMMENT '相对路径',
  `CREATED_BY` bigint(20) DEFAULT NULL COMMENT '创建人',
  `CREATION_DATE` datetime DEFAULT NULL COMMENT '创建时间',
  `LAST_UPDATED_BY` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `LAST_UPDATED_DATE` datetime DEFAULT NULL COMMENT '最后更新时间',
  `ENABLED_FLAG` char(1) DEFAULT NULL COMMENT '有效性',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `node_file` */

/*Table structure for table `node_file_history` */

DROP TABLE IF EXISTS `node_file_history`;

CREATE TABLE `node_file_history` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `VERSION` bigint(20) DEFAULT NULL COMMENT '数据版本',
  `NODE_HISTORY_ID` bigint(20) DEFAULT NULL COMMENT '所属节点历史ID',
  `FILE_ID` bigint(20) DEFAULT NULL COMMENT '所属文件ID',
  `RELATIVE_PATH` varchar(500) DEFAULT NULL COMMENT '相对路径',
  `CREATED_BY` bigint(20) DEFAULT NULL COMMENT '创建人',
  `CREATION_DATE` datetime DEFAULT NULL COMMENT '创建时间',
  `LAST_UPDATED_BY` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `LAST_UPDATED_DATE` datetime DEFAULT NULL COMMENT '最后更新时间',
  `ENABLED_FLAG` char(1) DEFAULT NULL COMMENT '有效性',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `node_file_history` */

/*Table structure for table `node_file_instance` */

DROP TABLE IF EXISTS `node_file_instance`;

CREATE TABLE `node_file_instance` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `VERSION` bigint(20) DEFAULT NULL COMMENT '数据版本',
  `NODE_INSTANCE_ID` bigint(20) DEFAULT NULL COMMENT '所属节点实例ID',
  `FILE_VERSION_ID` bigint(20) DEFAULT NULL COMMENT '关联文件版本ID',
  `RELATIVE_PATH` varchar(500) DEFAULT NULL COMMENT '相对路径',
  `INSTANCE_ID` varchar(250) DEFAULT NULL COMMENT '文件实例ID',
  `CREATED_BY` bigint(20) DEFAULT NULL COMMENT '创建人',
  `CREATION_DATE` datetime DEFAULT NULL COMMENT '创建时间',
  `LAST_UPDATED_BY` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `LAST_UPDATED_DATE` datetime DEFAULT NULL COMMENT '最后更新时间',
  `ENABLED_FLAG` char(1) DEFAULT NULL COMMENT '有效性',
  `STATUS` varchar(250) DEFAULT NULL COMMENT '状态',
  `CR_STATUS` varchar(250) DEFAULT NULL COMMENT '扩展状态，部署时使用',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

