/* Procedure structure for procedure `createCodeChildLst` */

/*!50003 DROP PROCEDURE IF EXISTS  `createCodeChildLst` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`10.190.1.185` PROCEDURE `createCodeChildLst`(
	IN rootId VARCHAR(36),
	IN nDepth INT
)
BEGIN
	DECLARE step INT DEFAULT 0;
	DECLARE tmp varchar(36);
	DECLARE cur1 CURSOR FOR SELECT id FROM tb_code WHERE ParentId = rootId and PysicalState = 1;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET step = 1;
	INSERT INTO tb_code_tmp VALUES (NULL,rootId,nDepth);
	OPEN cur1;
		FETCH cur1 INTO tmp;
		WHILE step = 0 DO
			CALL createCodeChildLst(tmp,nDepth+1);
			FETCH cur1 INTO tmp;
		END WHILE;
	CLOSE cur1;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `createSecGroupParentLst` */

/*!50003 DROP PROCEDURE IF EXISTS  `createSecGroupParentLst` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`10.190.1.185` PROCEDURE `createSecGroupParentLst`(
	IN groupId varchar(45),
	IN nDepth INT
)
BEGIN
	DECLARE step INT DEFAULT 0;
	DECLARE tmp VARCHAR(45);
	DECLARE cur1 CURSOR FOR SELECT parentId FROM sec_group s WHERE s.groupId = groupId and s.groupId != '0';
	
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET step = 1;
	INSERT INTO sec_group_tmp VALUES (NULL,groupId,nDepth); /** 插入当前数据 */
	OPEN cur1;
		FETCH cur1 INTO tmp;
		IF(step = 0) THEN
			CALL createSecGroupParentLst(tmp,nDepth+1);
		END IF;
	CLOSE cur1;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `showCodeChildLst` */

/*!50003 DROP PROCEDURE IF EXISTS  `showCodeChildLst` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`10.190.1.185` PROCEDURE `showCodeChildLst`(
	IN rootId VARCHAR(36)
)
BEGIN
	SET max_sp_recursion_depth=20;
	CREATE TEMPORARY TABLE IF NOT EXISTS tb_code_tmp 
	  (sno INT PRIMARY KEY AUTO_INCREMENT,
	   id VARCHAR(36),
	   depth INT);
	DELETE FROM tb_code_tmp;
	
	CALL createCodeChildLst(rootId,0);
	
	SELECT ct.*,c.* FROM tb_code_tmp ct,tb_code c WHERE ct.id=c.id ORDER BY c.no;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `showSecGroupFullGroupNameLst` */

/*!50003 DROP PROCEDURE IF EXISTS  `showSecGroupFullGroupNameLst` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`10.190.1.185` PROCEDURE `showSecGroupFullGroupNameLst`(
	IN groupId varchar(45)
)
BEGIN
	SET max_sp_recursion_depth=5;
	CREATE TEMPORARY TABLE IF NOT EXISTS sec_group_tmp 
	  (sno INT PRIMARY KEY AUTO_INCREMENT,
	   groupId varchar(45),
	   depth INT);
	DELETE FROM sec_group_tmp;
	
	CALL createSecGroupParentLst(groupId,0);
	
	SELECT GROUP_CONCAT(g.name ORDER BY gt.sno DESC SEPARATOR '/') AS fullGroupName
	FROM sec_group_tmp gt
	LEFT JOIN sec_group g ON gt.groupId = g.groupId;
    END */$$
DELIMITER ;

